import React from 'react';
import {Card,CardImg,CardBody,CardTitle} from "reactstrap";

function RenderInfo ({info}) {

if (info != null)
return (
  <div className=" col-12 col-md-10 m-1 ">
  <Card >
  <CardImg src='../assets/hoss.jpeg' alt='photo' />
  <CardBody>
    <CardTitle className='row justify-content-center'>I am a web developer</CardTitle>
  </CardBody>
</Card>
</div>
)
}

const Info = (props) =>{
return (
<div className='container'>
  <div className='align-self-center offset-md-2 '>
    <RenderInfo info = {props.click}/>
  </div>
</div>
)}

export default Info
